import React from "react";

const CustomerForm = () => {
  return (
    <div className="form text-left">
      <form>
        <label>First Name </label>
        <input type="text" />
        <label>Last Name</label>
        <input type="text" />
      </form>
    </div>
  );
};

export default CustomerForm;
